  false,\n\t\"url\": null,\n\t\"notes\": \"When Hooper Bay, Chevak area was visited
  by the writer in 1941, because of low water and poor transportation, the area was
  not reached until the evening of June 21. At: this time many of the waterfowl had
  hatched off. Itu2019s impossible to obtain data on migration arrivals, egg depredation
  studies, egg counts, and many other data that should be had to complete an investigation.
  Because of this late arrival, Hooper Bay, Chevak area, was again visited in 1942.
  It is felt that the work of 1941 from June 21 on was sufficient study for that portion
  of the year until the birds had left that area. However, the second visit was necessary
  to complete the nesting cycle of the waterfowl.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
